import React,{useState} from 'react';

const Form = () => {
    const [name,setName] = useState('')
    const handlename = (e) => {
        setName(e.target.value);
    }
    const [age,setAge] = useState('')
    const handleage = (e) => {
        setAge(e.target.value);
    }
    const [email,setEmail] = useState('')
    const handlemail = (e) => {
        setEmail(e.target.value);
    }
    return (
        <div className="form">
            <h3>
                User Registration
            </h3>
        <form>
            <div className='form-group'>
        <label className="label">Name</label>
        <input onChange={handlename} className="form-control" type="text" value={name}></input>
        </div>
        <label className="label">Age</label>
        <input onChange={handleage} className="input" type="number" value={age}></input>
        <label className="label">Email</label>
        <input onChange={handlemail} className="input" type="email" value={email}></input>
        </form>
        </div>
    );
}

export default Form;
